import React from "react"; 
import {Card} from "react-bootstrap";
import cardBack from ""

// const cardBack = "./back.png"

const Back = (props) => {

    return(
        <Card>
            <Card.Img variant="top" img src={require('./logo.jpeg')} /> {props.cardBack}
        </Card>
    )
}

export default Back;
